(()=>{
        //constructor
        const res={
            accent:(a)=> 
            {
                return Object.values(
                {
                    "blank":""
                    ,"gen":"data:image/png;base64,"
                    ,"jan":"data:image/png;base64,"
                    ,"feb":"data:image/png;base64,"
                    ,"mar":"data:image/png;base64,"
                    ,"apr":"data:image/png;base64,"
                    ,"may":"data:image/png;base64,"
                    ,"jun":"data:image/png;base64,"
                    ,"jul":"data:image/png;base64,"
                    ,"aug":"data:image/png;base64,"
                    ,"sep":"data:image/png;base64,"
                    ,"oct":"data:image/png;base64,"
                    ,"nov":"data:image/png;base64,"
                    ,"dec":"data:image/png;base64,"
                })[a];
            }
            ,chain:(a)=>
            {
                a = (a > 0) ? a : 1; 
                return Object.values(
                {
                    "blank":""
                    ,"silver":"data:image/png;base64,"
                    ,"yellow":"data:image/png;base64,"
                    ,"rose":"data:image/png;base64,"
                    ,"white":"data:image/png;base64,"
                })[a];
            }
            ,alloy:(a)=> {return Object.values({"None":"#BABABA","Silver":"#BABABA", "9k Yellow Gold":"#E0B97F", "9k Rose Gold":"#DDB8A9", "9k White Gold":"#C0C0C0"})[a]}
            ,shadow:(a)=> {return Object.values({"None":"#808080","Silver":"#808080", "9k Yellow Gold":"#AB8854", "9k Rose Gold":"#BA9282", "9k White Gold":"#808080"})[a]}
        };

        const config={
            global:{canvasId:"canvas",screen:"rgba(231,245,249,0.8)"}
            ,"bold name necklace":
            {
                fontName:"bname"
                ,fontSize:35
                ,gemSize:14
                ,cw:450
                ,ch:450
                ,chainWidth:240
                ,prefixMap:(a)=>{return (a.length > 0 && a.substr(0,1).match(/[a-z]/g)) ? -30 : -50;}
                ,suffixMap:(accent,motif)=>
                {
                    let n = {0:-132, 1:-123, 2:-132, 3:-122,4:-124,5:-123,6:-132,7:-122};
                    return (accent === 0) ? Object.values(n)[motif] : Object.values(n)[motif+4];
                }
                ,accentMap:(bounds,i)=>{ let a = bounds.left+bounds.width;
                return {
                    x:Object.values({0:0, 1:0, 2:0, 3:0, 4:(a-10),5:(a-22),6:(a-12.5),7:(a-25)})[i]
                    ,y:Object.values({0:0, 1:0, 2:0, 3:0, 4:127,5:125,6:122,7:120})[i]}
                }
                ,prefixFn:(d)=> {return (d.length >= 1) ? String.fromCharCode(d.substring(0,1).charCodeAt(0) + 60000) : "";}
                ,infixFn:(a)=> {return (a.length > 1) ? a.substring(1,a.length) : "";}
                ,suffixFn:(a)=> {return String.fromCharCode(Object.values({0:61, 1:60091, 2:60040, 3:60123, 4:60062,5:60093,6:60041,7:60125})[a]);}
            }
            ,"classic name necklace":
            {
                fontName:"cname"
                ,fontSize:35
                ,gemSize:14
                ,cw:450
                ,ch:450
                ,chainWidth:240
                ,prefixMap:(a)=>{return (a.length > 0 && a.substr(0,1).match(/[a-z]/g)) ? -25 : -41;} //-126 : -142
                ,suffixMap:(accent,motif)=>
                {
                    let n = {0:-27,1:-21,2:-27,3:-19,4:-21,5:-21,6:-27,7:-19};
                    return (accent === 0) ? Object.values(n)[motif] : Object.values(n)[motif+4];
                }
                ,accentMap:(bounds,i)=>{ let a = bounds.left+bounds.width;
                return {
                    x:Object.values({0:0, 1:0, 2:0, 3:0, 4:(a-8),5:(a-15),6:(a-10),7:(a-18)})[i]
                    ,y:Object.values({0:0, 1:0, 2:0, 3:0, 4:228,5:226,6:223,7:221})[i]} //
                }
                ,prefixFn:(d)=> {return (d.length >= 1) ? String.fromCharCode(d.substring(0,1).charCodeAt(0) + 60000) : "";}
                ,infixFn:(a)=> {return (a.length > 1) ? a.substring(1,a.length) : "";}
                ,suffixFn:(a)=> {return String.fromCharCode(Object.values({0:61, 1:60091, 2:60040, 3:60123, 4:60062,5:60093,6:60041,7:60125})[a]);}
            }
            ,"mini name necklace":
            {
                fontName:"mname"
                ,fontSize:35
                ,gemSize:14
                ,cw:450
                ,ch:450
                ,chainWidth:240
                ,prefixMap:(a)=>{return (a.length > 0 && a.substr(0,1).match(/[a-z]/g)) ? -119 : -118;}
                ,suffixMap:(accent,motif)=>
                {
                    let n = {0:-119, 1:-119, 2:-119, 3:-119, 4:-119,5:-119,6:-119,7:-119};
                    return (accent === 0) ? Object.values(n)[motif] : Object.values(n)[motif+4];
                }
                ,accentMap:(bounds,i)=>{ let a = bounds.left+bounds.width;
                return {
                    x:Object.values({0:0, 1:0, 2:0, 3:0, 4:(a-6),5:(a-13),6:(a-9),7:(a-15)})[i]
                    ,y:Object.values({0:0, 1:0, 2:0, 3:0, 4:131,5:131,6:130,7:128})[i]}
                }
                ,prefixFn:(d)=> {return (d.length >= 1) ? String.fromCharCode(d.substring(0,1).charCodeAt(0) + 60000) : "";}
                ,infixFn:(a)=> {return (a.length > 1) ? a.substring(1,a.length) : "";}
                ,suffixFn:(a)=> {return String.fromCharCode(Object.values({0:61, 1:60091, 2:60040, 3:60123, 4:60062,5:60093,6:60041,7:60125})[a]);}
            }
        };
        
        const inputs=()=>
        {
            let user = {};
            user.txt1 = $("input[title='Enter your name here']");
                
            let tgt = $('select').toArray();
            $.each(tgt, (index)=> 
            {
                if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Silver")
                {
                    user.alloy = $(tgt)[index];
                }
                if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Heart")
                {
                    user.motif = $(tgt)[index];
                }
                if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Genuine Diamond")
                {
                    user.accent = $(tgt)[index];
                }
            }); 
            return user;
        };

        var msg = (a)=>{console.log(a);};

        var dev=false;
        var renderBounds=false;
        var con = config[$(".ty-product-block-title").text().toLowerCase()];  
        var canvas = new fabric.Canvas(config.global.canvasId,{backgroundColor:config.global.screen,width:con.cw,height:con.ch,objectCaching:false,hoverCursor:"pointer"});
        var user = inputs();
        var regex = (a)=> {return a.replace(/[\(\)\[\]:;#@\^\|\?\",<>\!\\_=\+\*~`\.\{\}']/g,"");};
        var allfix = "";
        var item={chainLeft:"",chainRight:"",bounds:"",pendant:""};

        //------------------------------------------------------//
        var getUserInput=()=>
        {
            msg(JSON.stringify($(user.accent)));
            allfix = "";
            let a = $(user.txt1).val();
            if(a.substring(0,1).match(/^[\&|\-]/g) || a === "" || a === "Enteryournamehere" || a === "Enter your name here") return;
            a = regex(a.split(" ").join(""));
            let b = ($(user.accent).prop("selectedIndex") === 0) ? con.suffixFn($(user.motif).prop("selectedIndex")) : con.suffixFn($(user.motif).prop("selectedIndex") + 4);
            allfix = (a.length > 0 && typeof $(user.accent).prop("selectedIndex") !== "undefined") ? con.prefixFn(a).concat(con.infixFn(a)).concat(b) : ""; 
        }

        var setBounds=()=>
        {	
            item.pendant =  new fabric.Text(allfix,{fontFamily:con.fontName,fontSize:con.fontSize,fill:"#b4b4b4",objectCaching:false});		
            canvas.add(item.pendant);
            item.pendant.center();
            item.bounds = item.pendant.getBoundingRect();
            if(!renderBounds){canvas.remove(item.pendant)};
        }

        var drawRegion=(bnd)=>
        {
            let aBox, bBox, cBox;
            aBox = new fabric.Rect({
                left:bnd.left - con.chainWidth
                ,top:bnd.top - con.chainWidth
                ,width:con.chainWidth
                ,height:con.chainWidth
                ,selectable:false
                ,fill:""
                ,stroke:"#f00"
                ,strokeWidth:0.25
            });

            bBox = new fabric.Rect(item.bounds);
                bBox.stroke="#0f0";
                bBox.fill="";
                bBox.strokeWidth=0.25;

            cBox = new fabric.Rect({
                left:bnd.width + bnd.left
                ,top:bnd.top - con.chainWidth
                ,width:con.chainWidth
                ,height:con.chainWidth
                ,selectable:false
                ,fill:""
                ,stroke:"#00f"
                ,strokeWidth:0.25
            });

            if(renderBounds) canvas.add(aBox).add(bBox).add(cBox);
        }
        
        var gemMap=()=>
        {
            let tg = $(user.motif).prop("selectedIndex");
            let plain = con.accentMap(item.bounds,tg);
            let accent = con.accentMap(item.bounds,tg+4);
            return ($(user.accent).prop("selectedIndex") === 0) ? {x:plain.x,y:plain.y} : {x:accent.x,y:accent.y};
            
        }

        var draw=()=>
        {
            canvas.clear();
            canvas.set({backgroundColor:config.global.screen});
            getUserInput();
            setBounds();
            drawRegion(item.bounds);

            item.pendant =  new fabric.Text(allfix,
            {
                fontFamily:con.fontName
                ,fontSize:con.fontSize
                ,fill:res.alloy($(user.alloy).prop("selectedIndex"))
                ,left:item.bounds.left
                ,top:item.bounds.top
                ,selectable:false
                ,shadow: `${res.shadow($(user.alloy).prop("selectedIndex"))} -1 -1 0`
                
            });		
            canvas.add(item.pendant);

            fabric.Image.fromURL(res.chain($(user.alloy).prop("selectedIndex")),(im)=>
            {
                im.scaleToWidth(con.chainWidth);
                im.set({left:item.bounds.left-con.chainWidth-3,top:con.prefixMap($(user.txt1).val()),objectCaching:false,selectable:false});
                if(allfix !== "") canvas.add(im);
            });

            fabric.Image.fromURL(res.chain($(user.alloy).prop("selectedIndex")),(im)=>
            {
                im.scaleToWidth(con.chainWidth);
                im.set({left:item.bounds.left+item.bounds.width+3,top:con.suffixMap($(user.accent).prop("selectedIndex"),$(user.motif).prop("selectedIndex")),flipX:true,objectCaching:false,selectable:false});
                if(allfix !== "") canvas.add(im);
            });
            
            fabric.Image.fromURL(res.accent($(user.accent).prop("selectedIndex")),(im)=>
            {
                im.scaleToWidth(con.gemSize);
                im.set({left:gemMap().x,top:gemMap().y,originX:"center",originY:"center",objectCaching:false,noScaleCache:false,selectable:false
                ,shadow:"rgba(0,0,0,1) 0 0 2"});
                if(allfix !== "") 
                {
                    canvas.add(im);
                    im.animate("angle",360,
                    {from:0,duration:7200,easing:fabric.util.ease.easeIn,onChange:canvas.renderAll.bind(canvas)});
                }
            });

            let dropShadow = new fabric.Circle(
                {
                    shadow:"rgba(0,0,0,1) 1 1 10",opacity:0.2,radius:(item.bounds.width * 0.5)
                    ,left:con.cw *0.5
                    ,top:con.ch*0.8
                    ,fill:"#efefef"
                    ,originX:"center"
                    ,originY:"center"
                    ,scaleY:0.01
                    ,objectCaching:false
                    ,selectable:false
                });
            
                canvas.add(dropShadow);
        }

        var debug=()=>{
		if(!dev) return;
		let report=
		{
			init:"Hello from scriptName"
			,userTxt: $(user.txt1).val()
			,alloy:$(user.alloy).prop("selectedIndex")
			,motif:$(user.motif).prop("selectedIndex")
			,accent:$(user.accent).prop("selectedIndex")
			,bounds:item.bounds
			,allfix:allfix
			,config:con
		}
		msg(JSON.stringify(report));
        }
    
        //------------------------------------------------------------------------------------------------------------//
        //-----------------------------------------------------------------------------------------------------------//
        var render = ()=>
        {
            $(document).on("keyup change", [user.txt1,user.alloy], (e)=>
            {	
                user = inputs();
                draw();
                debug();
            });
        }

        return render();
    })();

 